import React from 'react';
import styled from 'styled-components';
import logo from '../img/logo.png';
import HomeIcon from '@mui/icons-material/Home';
import ExploreOutlinedIcon from "@mui/icons-material/ExploreOutlined";
import SubscriptionsOutlinedIcon from "@mui/icons-material/SubscriptionsOutlined";
import VideoLibraryOutlinedIcon from "@mui/icons-material/VideoLibraryOutlined";
import HistoryOutlinedIcon from "@mui/icons-material/HistoryOutlined";
import LibraryMusicOutlinedIcon from "@mui/icons-material/LibraryMusicOutlined";
import SportsEsportsOutlinedIcon from "@mui/icons-material/SportsEsportsOutlined";
import SportsBasketballOutlinedIcon from "@mui/icons-material/SportsBasketballOutlined";
import MovieOutlinedIcon from "@mui/icons-material/MovieOutlined";
import ArticleOutlinedIcon from "@mui/icons-material/ArticleOutlined";
import LiveTvOutlinedIcon from "@mui/icons-material/LiveTvOutlined";
import AccountCircleOutlinedIcon from "@mui/icons-material/AccountCircleOutlined";
import SettingsOutlinedIcon from "@mui/icons-material/SettingsOutlined";
import FlagOutlinedIcon from "@mui/icons-material/FlagOutlined";
import HelpOutlineOutlinedIcon from "@mui/icons-material/HelpOutlineOutlined";
import SettingsBrightnessOutlinedIcon from "@mui/icons-material/SettingsBrightnessOutlined";
import { Link } from "react-router-dom";


const Container = styled.div`
  flex:1;
  background-color: ${({ theme }) => theme.bgLighter};
  height:100vh;
  color: ${({ theme }) => theme.text};
  font-size: 14px;
  position:sticky;
  top:0;
`;


// position:sticky;
// top:0;
// mane holo main portion scrolled holeo menu top 0 point theke sticky hoe thakbe.mane sorbe na

//   height:5vh mane holo ei component total jottuk space pae tar 5% nibe.. ekhane 00vh mane puratai nibe
// padding: top-bottom left-right
const Wrapper = styled.div`
  padding:18px 26px;
`;

const Logo = styled.div`
  display:flex;
  align-items:center;
  gap:5px;
  font-weight:bold;
  margin-bottom: 25px;
`;

const Img = styled.img`
  height: 25px;
`;


const Item = styled.div`
  display:flex;
  align-items:center;
  gap: 20px;
  cursor:pointer;
  padding: 7.5px 0px;
`;

const Login = styled.div`

`;

const Button = styled.button`
  padding: 5px 15px;
  background-color:transparent;
  border: 1px solid #3ea6ff;
  color: #3ea6ff;
  border-radius: 3px;
  font-weight: 600;
  margin-top: 10px;
  cursor:pointer;
  display: flex;
  align-items:center;
  gap:5px;

`;

const Hr = styled.hr`
  margin:15px 0px;
  border: 0.5px solid ${({ theme }) => theme.soft};;
`;


const Title = styled.div`
  font-size: 14px;
  font-weight: 500;
  color: #aaaaaa;
  margin-bottom: 20px;
`;


const Menu = ({ darkMode, setDarkMode }) => {
  return (
    <Container>
      <Wrapper>
        <Link to="/" style={{ textDecoration: "none" }}>
          <Logo>

            <Img src={logo} />
            FahimTube
          </Logo>
        </Link>
        <Item>
          <HomeIcon />
          Home
        </Item>

        <Item>
          <ExploreOutlinedIcon />
          Explore
        </Item>
        <Item>
          <SubscriptionsOutlinedIcon />
          Subscriptions
        </Item>

        <Hr />

        <Item>
          <VideoLibraryOutlinedIcon />
          Library
        </Item>
        <Item>
          <HistoryOutlinedIcon />
          History
        </Item>

        <Hr />

        <Login>
          Sign In to post comments,like videos and subscribe
          <Button>
            <AccountCircleOutlinedIcon />
            LOG IN
          </Button>
        </Login>

        <Hr />
        <Title>Welcome to FahimTube</Title>
        <Item>
          <LibraryMusicOutlinedIcon />
          Music
        </Item>
        <Item>
          <SportsBasketballOutlinedIcon />
          Sports
        </Item>
        <Item>
          <SportsEsportsOutlinedIcon />
          Gaming
        </Item>
        <Item>
          <MovieOutlinedIcon />
          Movies
        </Item>
        <Item>
          <ArticleOutlinedIcon />
          News
        </Item>
        <Item>
          <LiveTvOutlinedIcon />
          Live
        </Item>

        <Hr />

        <Item>
          <SettingsOutlinedIcon />
          Settings
        </Item>
        <Item>
          <FlagOutlinedIcon />
          Report
        </Item>
        <Item>
          <HelpOutlineOutlinedIcon />
          Help
        </Item>

        <Item onClick={() => setDarkMode(!darkMode)}>
          <SettingsBrightnessOutlinedIcon />
          Theme
        </Item>

        <Hr />

      </Wrapper>
    </Container>
  )
}

export default Menu
